                    <a href="/analytics" className="font-thin active:font-bold">Analytics</a>
                    <h1 className="font-thin">Data</h1>
                    <h1 className="font-thin">How it works</h1>
                    <h1 className="font-thin">Github</h1>
                </div>
            </div>
        </div>
    );

}
